import React from 'react';
import { Col, Container, Row } from 'react-bootstrap';

import Article from '../components/Article';
import Header from '../components/Header';

export default class QuestPage extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            articleList: [
                {
                    articleTitle: "What are quests?",
                    articleContent: "Quests are a set of tasks that lead you to explore the HoloTag World. These tasks may be things such as finding and photographing"
                }
            ],
            title: props.title
        }
    }

    loadArticles = (articleList) => {
        return articleList.map(article => {
            return <Article />
        });
    }

    render() {
        return (
            <div>
                <Header />
                <Container>
                    {this.loadArticles(this.state.articleList)}
                </Container>
            </div>
        );
    }
}
